import{_ as a,o as e,c as t,R as r}from"./chunks/framework.bQUviISV.js";const m=JSON.parse('{"title":"","description":"","frontmatter":{},"headers":[],"relativePath":"Start/网站分享.md","filePath":"Start/网站分享.md","lastUpdated":1702657765000}'),p={name:"Start/网站分享.md"},n=r('<h2 id="设计篇" tabindex="-1">设计篇 <a class="header-anchor" href="#设计篇" aria-label="Permalink to &quot;设计篇&quot;">​</a></h2><p><a href="https://www.iconfont.cn/?spm=a313x.collections_detail.i3.d4d0a486a.171a3a81UV7tuV" target="_blank" rel="noreferrer">iconfont</a></p><p>阿里巴巴团队倾力打造的矢量图标库, 内容丰富, 支持不同下载格式, 如png, svg等. 登陆网站后还可对喜欢的图标进行收藏方便使用, 可认为是设计师/前端开发者必备的图标管理宝藏网站. 其中矢量图标的svg代码为博客网站的设计提供了很大的便利, 如本站的友情链接icon图标就是从该网站下载并直接使用的.</p><p><a href="https://www.bitbug.net/" target="_blank" rel="noreferrer">bitbug</a></p><p>比特虫: icon图标在线转换网站, 支持.jpg, gif, png等图像输入格式, 上传原始图像并输入验证码便可实现轻松转换.</p><p><a href="https://blog.csdn.net/F1004145107/article/details/106999446/" target="_blank" rel="noreferrer">Typora中的emoji标签</a></p><p>该博客中汇总了Typora中的emoji标签, 可用于博客写作中的内容设计.</p><h2 id="数学公式篇" tabindex="-1">数学公式篇 <a class="header-anchor" href="#数学公式篇" aria-label="Permalink to &quot;数学公式篇&quot;">​</a></h2><p><a href="http://detexify.kirelabs.org/classify.html" target="_blank" rel="noreferrer">Latex符号手写识别</a></p><p><a href="https://accounts.mathpix.com/signup?return_to=/account" target="_blank" rel="noreferrer">Mathpix</a></p><p>数学公式识别神器, 可根据截图, PDF文件或手写笔记提取公式并给出Latex格式, 准确率极高, 复制后可直接用于Latex写作, Word公式编辑器或Markdown文档编写中, 极大的提高了写作效率, 可认为是科研论文写作必备工具网站.</p><p><a href="https://www.latexlive.com/" target="_blank" rel="noreferrer">Latexlive</a></p><p>Latex公式编辑器, 可将编辑好的latex公式以多种形式输出, 如.png, .svg图片格式, html代码格式等, 该网站也支持公式图片识别, 并配有完善的latex公式模板, 便于原始公式编辑. 对于latex公式到word公式的格式转换比较友好.</p><hr><p><a href="https://zhuanlan.zhihu.com/p/490291830" target="_blank" rel="noreferrer">字体包</a></p><p>知乎专栏分享的 “常用字体:仿宋GB2312、楷体GB2312、方正小标宋简体的下载和安装方式”, 可解写作中的燃眉之急, 配享太庙.</p><h2 id="pdf文档工具" tabindex="-1">PDF文档工具 <a class="header-anchor" href="#pdf文档工具" aria-label="Permalink to &quot;PDF文档工具&quot;">​</a></h2><p><a href="https://smallpdf.com/" target="_blank" rel="noreferrer">Smallpdf</a></p><p>处理PDF文档的工具网站, 支持PDF文件的压缩, 编辑及各种常用格式的相互转换.</p><p>不足之处: 网站有一定的免费次数限制, 且用且珍惜.</p><h2 id="学习网站-博客分享" tabindex="-1">学习网站&amp;博客分享 <a class="header-anchor" href="#学习网站-博客分享" aria-label="Permalink to &quot;学习网站&amp;博客分享&quot;">​</a></h2><p><a href="https://games-cn.org/page/2/" target="_blank" rel="noreferrer">计算机图形学与混合现实在线平台</a></p><p>也可去B站直接搜索GAMES-Webinar观看各位大佬的往期报告视频.</p><p><a href="https://www.cnblogs.com/tiandsp/p/14337176.html" target="_blank" rel="noreferrer">Dsp Tian</a></p><p>某位算法工程师的博客园网站, 包含了很多MATLAB练习代码, 可用于学习参考.</p><h2 id="整理中" tabindex="-1">整理中... <a class="header-anchor" href="#整理中" aria-label="Permalink to &quot;整理中...&quot;">​</a></h2>',26),o=[n];function l(h,i,s,c,d,_){return e(),t("div",null,o)}const b=a(p,[["render",l]]);export{m as __pageData,b as default};
